import React, { Component } from 'react';
import introImage from '../images/intro-pic.jpg';

class IntroPage extends Component {

  render() {
    return (
      <div class="showcase">
        <div class="image-container">
          <img src={introImage}></img>
        </div>
        <div class="content">
          <p>Hi, I'm</p>
          <h1>Kenneth An</h1>
        </div>
      </div>
    )
  }

}

export default IntroPage;
